import React from "react";
import {
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from "reactstrap";
const marg = {
  marginTop: "2vw",
  textDecoration: "none",
  fontSize: "16px"
};

function Drop() {
  return (
    <UncontrolledDropdown>
      <DropdownToggle nav caret style={marg}>
        Languages
      </DropdownToggle>
      <DropdownMenu right>
        <DropdownItem>English</DropdownItem>
        <DropdownItem>German</DropdownItem>
        <DropdownItem>Indonesian</DropdownItem>
        <DropdownItem>Arabic</DropdownItem>
        <DropdownItem>Turkish</DropdownItem>
        <DropdownItem>French</DropdownItem>
        <DropdownItem>Urdu</DropdownItem>
      </DropdownMenu>
    </UncontrolledDropdown>
  );
}
export default Drop;
